import React from 'react'
import HeroSlider, { Slide } from 'hero-slider';
const b1= <img src={require("../assets/banner1.png")}/>
const b2= <img src={require("../assets/banner1.png")}/>

export default function Home() {
  return (
    // <div id="carouselInterval" class="carousel slide" data-bs-interval="5000" data-bs-ride="carousel">
    //   <div class="carousel-inner">
    //     <div class="carousel-item active">
    //       <img src={require("../assets/banner1.png")} class="d-block w-100" alt="ban1" />
    //     </div>
    //     <div class="carousel-item">
    //       <img src={require("../assets/banner2.png")} class="d-block w-100" alt="ban2" />
    //     </div>
    //     <div class="carousel-item">
    //       <img src={require("../assets/banner3.png")} class="d-block w-100" alt="ban3" />
    //     </div>
    //   </div>
    //   <button class="carousel-control-prev" type="button" data-bs-target="#carouselExampleInterval" data-bs-slide="prev">
    //     <span class="carousel-control-prev-icon" aria-hidden="true"></span>
    //     <span class="visually-hidden">Previous</span>
    //   </button>
    //   <button class="carousel-control-next" type="button" data-bs-target="#carouselExampleInterval" data-bs-slide="next">
    //     <span class="carousel-control-next-icon" aria-hidden="true"></span>
    //     <span class="visually-hidden">Next</span>
    //   </button>
    // </div>
    <HeroSlider
    slidingAnimation="left_to_right"
    orientation="horizontal"
    initialSlide={1}
    onBeforeChange={(previousSlide, nextSlide) =>
      console.log("onBeforeChange", previousSlide, nextSlide)
    }
    onChange={nextSlide => console.log("onChange", nextSlide)}
    onAfterChange={nextSlide => console.log("onAfterChange", nextSlide)}
    style={{
      backgroundColor: "rgba(0, 0, 0, 0.33)"
    }}
    settings={{
      slidingDuration: 250,
      slidingDelay: 100,
      shouldAutoplay: true,
      shouldDisplayButtons: true,
      autoplayDuration: 5000,
      height: "100vh"
    }}
  >
    <OverlayContainer>
      <Wrapper>
        <Title>Basic Slider</Title>
        <Subtitle>Slides' background attachment set to fixed</Subtitle>
      </Wrapper>
    </OverlayContainer>

    <Slide
      background={{
        backgroundImage: b1,
        backgroundAttachment: "fixed"
      }}
    />

    <Slide
      background={{
        backgroundImage: bogliasco,
        backgroundAttachment: "fixed"
      }}
    />

    <Slide
      background={{
        backgroundImage: countyClare,
        backgroundAttachment: "fixed"
      }}
    />

    <Slide
      background={{
        backgroundImage: craterRock,
        backgroundAttachment: "fixed"
      }}
    />

    <Nav />
  </HeroSlider>
  )
}
